import { useState } from "react";
import { useForm } from "react-hook-form";
import RedichanNav from 'RedichanNav';
import 'bootstrap/dist/css/bootstrap.min.css';

const StartThread = ():JSX.Element => {
  const { register, handleSubmit } = useForm();
  const [data, setData] = useState("");

  return (
    <div className="StartThread mx-auto">
    <RedichanNav />
    <form onSubmit={handleSubmit((inputData) => void setData(JSON.stringify(inputData)))}>
      <textarea {...register("text")} />
      <input type="submit" />
      <button aria-label="close" type="submit" />
    </form>
    </div>
  );
}

export default StartThread;
